import React, { useEffect, useState } from 'react';
import {
  Dialog, DialogTitle, DialogContent, DialogActions, Button, Table, TableBody, TableCell, TableHead, TableRow, IconButton, Checkbox, TextField
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import { getDarkFiberDetails, addDarkFiberDetail, editDarkFiberDetail, deleteDarkFiberDetail } from './api';

const defaultForm = {
  dwdm_wavelength: '',
  equipment: '',
  in_use: false,
  capex_cost_to_light: '',
};

function DarkFiberModal({ open, onClose, circuitId }) {
  const [rows, setRows] = useState([]);
  const [loading, setLoading] = useState(true);
  const [formOpen, setFormOpen] = useState(false);
  const [formMode, setFormMode] = useState('add');
  const [formData, setFormData] = useState(defaultForm);
  const [editId, setEditId] = useState(null);

  const fetchRows = async () => {
    setLoading(true);
    const data = await getDarkFiberDetails(circuitId);
    setRows(data);
    setLoading(false);
  };

  useEffect(() => {
    if (open && circuitId) fetchRows();
  }, [open, circuitId]);

  const handleAdd = () => {
    setFormMode('add');
    setFormData(defaultForm);
    setFormOpen(true);
    setEditId(null);
  };
  const handleEdit = (row) => {
    setFormMode('edit');
    setFormData({
      dwdm_wavelength: row.dwdm_wavelength || '',
      equipment: row.equipment || '',
      in_use: !!row.in_use,
      capex_cost_to_light: row.capex_cost_to_light || '',
    });
    setEditId(row.id);
    setFormOpen(true);
  };
  const handleDelete = async (id) => {
    await deleteDarkFiberDetail(id);
    fetchRows();
  };
  const handleFormSubmit = async () => {
    if (formMode === 'add') {
      await addDarkFiberDetail({ ...formData, circuit_id: circuitId });
    } else if (formMode === 'edit') {
      await editDarkFiberDetail(editId, formData);
    }
    setFormOpen(false);
    fetchRows();
  };

  useEffect(() => {
    if (!formOpen && formMode === 'add') {
      setFormData(defaultForm);
      setEditId(null);
    }
  }, [formOpen, formMode]);

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <DialogTitle>Dark Fiber Details for {circuitId}</DialogTitle>
      <DialogContent>
        {loading ? (
          <div>Loading...</div>
        ) : (
          <Table size="small">
            <TableHead>
              <TableRow>
                <TableCell>DWDM Wavelength</TableCell>
                <TableCell>Equipment</TableCell>
                <TableCell>In Use</TableCell>
                <TableCell>CAPEX Cost to Light</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {rows.map(row => (
                <TableRow key={row.id}>
                  <TableCell>{row.dwdm_wavelength}</TableCell>
                  <TableCell>{row.equipment}</TableCell>
                  <TableCell><Checkbox checked={!!row.in_use} disabled /></TableCell>
                  <TableCell>{row.capex_cost_to_light}</TableCell>
                  <TableCell>
                    <IconButton onClick={() => handleEdit(row)}><EditIcon /></IconButton>
                    <IconButton onClick={() => handleDelete(row.id)}><DeleteIcon /></IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        )}
        <Button startIcon={<AddIcon />} onClick={handleAdd} sx={{ mt: 2 }}>Add</Button>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Close</Button>
      </DialogActions>
      {/* Add/Edit Form Dialog */}
      <Dialog open={formOpen} onClose={() => setFormOpen(false)}>
        <DialogTitle>{formMode === 'add' ? 'Add' : 'Edit'} Dark Fiber Detail</DialogTitle>
        <DialogContent>
          <TextField
            label="DWDM Wavelength"
            value={formData.dwdm_wavelength}
            onChange={e => setFormData(f => ({ ...f, dwdm_wavelength: e.target.value }))}
            fullWidth
            sx={{ mb: 2 }}
          />
          <TextField
            label="Equipment"
            value={formData.equipment}
            onChange={e => setFormData(f => ({ ...f, equipment: e.target.value }))}
            fullWidth
            sx={{ mb: 2 }}
          />
          <TextField
            label="CAPEX Cost to Light"
            value={formData.capex_cost_to_light}
            onChange={e => setFormData(f => ({ ...f, capex_cost_to_light: e.target.value }))}
            type="number"
            fullWidth
            sx={{ mb: 2 }}
          />
          <div>
            <Checkbox
              checked={!!formData.in_use}
              onChange={e => setFormData(f => ({ ...f, in_use: e.target.checked }))}
            /> In Use
          </div>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setFormOpen(false)}>Cancel</Button>
          <Button onClick={handleFormSubmit} variant="contained">{formMode === 'add' ? 'Add' : 'Save'}</Button>
        </DialogActions>
      </Dialog>
    </Dialog>
  );
}

export default DarkFiberModal;
